import React from 'react';

function VideoPreviewComponent({ processedFramePath }) {
  console.log("processedFramePath: ", processedFramePath);
  return (
    <div className="video-preview-component">
      <h2>Preview</h2>
      {processedFramePath && <img src={`http://localhost:5000/processed_videos/${processedFramePath}`} alt="Processed Frame" />}
    </div>
  );
}

export default VideoPreviewComponent;
